function initialize(){getAllListings(),addEventListeners()}function addEventListeners(){}function displayListings(a){for(var b=0;b<a.length;b++){var c=a[b].cost?$("#for-sale"):$("#for-rent");console.log(c),c.append(a[b])}}function getAllListings(){$.ajax({type:"GET",url:"/listings",success:function(a){displayListings(a)}})}$(document).ready(function(){initialize()});